import React from 'react'
import { MDBCol, MDBContainer, MDBFormInline, MDBIcon } from "mdbreact";

function Searchbar() {
    return (
        <MDBContainer>
            <MDBIcon icon="search"/>
            <input className="form-control form-control ml-3 w-75 mt-5" type="text" placeholder="Search" aria-label="Search" />
        </MDBContainer>
    )
}

export default Searchbar
